import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import { Routes } from 'react-router-dom';
import MainPage from './pages/index';
import './styles/styles.scss';

function App() {
  return (
    <Routes>
        <Route exact path="/">
          <MainPage />
        </Route>
      </Routes>
  );
}

export default App;
